import React, { useState } from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Subscription() {
  const [selectedPlan, setSelectedPlan] = useState(null);

  return (
    <div onClick={() => setSelectedPlan(null)} style={{ position: "relative" }}>
      <h1 style={{ color: "#004cff", fontSize: "100px" }}>인뱅</h1>
      <h2 style={{ color: "#004cff" }}>In-Bang</h2>
      <p style={{ color: "#ffffff" }}>
        <br />
        Choose your stated plan
      </p>
      <p style={{ color: "#ffffff", fontSize: "12px" }}>
        <br />
        /Ad free.
        <br />
        /Change or cancel plans anytime.
      </p>
      <div
        style={{
          padding: "10px",
          position: "center",
          backgroundColor: "#1200b8",
          marginTop: "10px",
          marginLeft: "auto",
          marginRight: "auto",
        }}
      >
        <div style={{ display: "inline-block" }}>
          <table
            style={{
              backgroundColor: "#1200b8",
              color: "#ffffff",
            }}
          >
            <tbody>
              <tr>
                <td style={{ padding: "20px", textAlign: "center" }}></td>
                <td style={{ padding: "20px", textAlign: "center" }}>
                  <button
                    style={{
                      backgroundColor:
                        selectedPlan === "Standard" ? "#fc2003" : "transparent",
                      color: "#ffffff",
                      border: "none",
                    }}
                    onClick={(e) => {
                      e.stopPropagation();
                      setSelectedPlan("Standard");
                    }}
                  >
                    Standard
                  </button>
                </td>
                <td style={{ padding: "20px", textAlign: "center" }}>
                  <button
                    style={{
                      backgroundColor:
                        selectedPlan === "Premium" ? "#fc2003" : "transparent",
                      color: "#ffffff",
                      border: "none",
                    }}
                    onClick={(e) => {
                      e.stopPropagation();
                      setSelectedPlan("Premium");
                    }}
                  >
                    Premium
                  </button>
                </td>
              </tr>
              <tr>
                <td style={{ padding: "20px", textAlign: "center" }}>
                  Monthly Price
                </td>
                <td style={{ padding: "20px", textAlign: "center" }}>₱250</td>
                <td style={{ padding: "20px", textAlign: "center" }}>₱530</td>
              </tr>
              <tr>
                <td style={{ padding: "20px", textAlign: "center" }}>
                  Video Quality
                </td>
                <td style={{ padding: "20px", textAlign: "center" }}>720p</td>
                <td style={{ padding: "20px", textAlign: "center" }}>
                  4k + HDR
                </td>
              </tr>
            </tbody>
          </table>
        </div>
        <Link
          to="/"
          style={{
            position: "absolute",
            right: "10px",
            top: "10px",
            textDecoration: "none",
          }}
        >
          <button
            style={{
              backgroundColor: "#fc2003",
              color: "#000000",
              padding: "5px",
            }}
          >
            X
          </button>
        </Link>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginTop: "20px",
        }}
      >
        <Link to="/login">
          <button
            style={{
              backgroundColor: "#1200b8",
              color: "#ffffff",
              padding: "5px",
            }}
          >
            Next
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Subscription;
